% addpath("Applications/Fiji.app/scripts");
% addpath("Li lab/code")
% addpath(genpath("Documents/MATLAB"));
% addpath(genpath("Documents/Li lab/data"));
%%
%[text] ## get table from TrackMate spots table
% [file,path] = uigetfile('*spots.csv');
% T = fullfile(path,file);
% spotTable = readtable(T);
spotTable = Pos05_spots;
%%
% [file,path] = uigetfile('*tracks.csv');
% T = fullfile(path,file);
% tracks = readtable(T);
tracks = Pos05_tracks;
%%
% [file,path] = uigetfile('*edges.csv');
% T = fullfile(path,file);
% edgeTable = readtable(T);
edgeTable = Pos05_edges;
%%
numTracks = max(spotTable.TRACK_ID);
spotTable = sortrows(spotTable,{'TRACK_ID','FRAME'});
spotTable = rmmissing(spotTable,'DataVariables',{'LABEL'});
tracks = rmmissing(tracks,'DataVariables',{'LABEL'});
edgeTable = rmmissing(edgeTable,'DataVariables',{'LABEL'});
%%
%[text] ## find where cells are at t0
cellsat0 = table(spotTable.LABEL(spotTable.FRAME == 0),spotTable.POSITION_X(spotTable.FRAME == 0));
%%
figure %[output:476efd91]
histogram(cellsat0.Var2,30)%use this to choose where to start bins %[output:476efd91]
%%
%[text] ## set values for bins and bin cells (bins set here are ultimately irrelevent, replaced later in analysis)
x0 = 400;
binint = 40;
t = 0;
spotTable = bincellsbyx(spotTable,binint,x0,t); %gives all spots connected to frame 0 a bin
%%
%[text] ## get each successive qp frame, match up to cell IDs from TM
nFrames = max(spotTable.FRAME);
cellofcorrs = cell(nFrames,1);
path = uigetdir; %location of qp data
%%
posnum = "Pos05"; %change as needed - CHANGE THIS TO PULL FROM FILE NAME
%%
for i = [1:43] %iterates over all frames %[output:group:8887bd96]
      if i < 10
        qpTable = readtable(path+"/"+posnum+"_0"+num2str(i) + "/Result/PCA_Cell-By-Cell_Polarity.csv"); %[output:9792b069] %[output:8062845a] %[output:23fa506e] %[output:7f2fa41b] %[output:65c309ed] %[output:22098d80] %[output:3c27f4e1] %[output:922b098a] %[output:725cbc36]
        qpCells = imread(path+"/"+posnum+"_0"+num2str(i) + "/Result/Cell_Identity.tif");
    else
        qpTable = readtable(path+"/"+posnum+"_"+num2str(i) + "/Result/PCA_Cell-By-Cell_Polarity.csv"); %[output:3f175b6a] %[output:6a5302f0] %[output:11189eee] %[output:8b9f448e] %[output:1cc0bd22] %[output:36fc4e3c] %[output:5b283153] %[output:643423a2] %[output:3914d097] %[output:9e9d1b25] %[output:9d97b001] %[output:4d34b021] %[output:5221c192] %[output:711acaef] %[output:194c7c06] %[output:0ceb5257] %[output:3b4ee492] %[output:7970d4ea] %[output:51b3f4e7] %[output:0010927d] %[output:667fc4d4] %[output:0c7d257f] %[output:2b2340a8] %[output:3c8fdf7f] %[output:09fab497] %[output:70f0583a] %[output:8b3e0069] %[output:6471ab44] %[output:6964b858] %[output:28257b07] %[output:39084e90] %[output:89fcbc87] %[output:9a464c10] %[output:27260c6e]
        qpCells = imread(path+"/"+posnum+"_"+num2str(i) + "/Result/Cell_Identity.tif");
    end
    TMframe = i; %-1; (if qp starts from 1 and TM from 0)
    qpfmask = spotTable.FRAME == TMframe; % make a mask of only the current frame
    qpframeTab = spotTable(qpfmask,:); %mask spotTable with it
    % sizely = min([height(qpframeTab),height(qpTable)]);
    sizely = min([height(qpframeTab)]);
    corr_table = table('Size',[sizely 3],'VariableTypes',{'string','double','double'},'VariableNames',["TMCellLabel","QPCellID","TMTrackID"]);
    corr_table(:,1)=  qpframeTab(:,1);
     corr_table.TMTrackID = qpframeTab.TRACK_ID;
     qpCellval=[];
       %retrieves gray val of identity image at TM cell coordinate
        for m =1:sizely
        qpCellval(m) = qpCells(round(qpframeTab.POSITION_Y(m)),round(qpframeTab.POSITION_X(m))); 
        end
        corr_table.QPCellID =  qpCellval';
         corr_table.QPCellID(corr_table.QPCellID==0) = nan;
        corr_table = corr_table(~any(ismissing(corr_table),2),:);
     %checks that we're only looking at cells in the right frame
    C = setdiff(corr_table.QPCellID,qpTable.CellIdentity);
    if isempty(C) == 0
        for rv = height(C)
            corr_table = corr_table(~(corr_table.QPCellID == C(rv,1)),:);
        end
    end
    corr_table = join(corr_table,qpTable,"LeftKeys",'QPCellID','RightKeys','CellIdentity');
    corr_table = join(corr_table,spotTable,"LeftKeys","TMCellLabel","RightKeys","LABEL");
    cellofcorrs{i+1,1} = corr_table;
    clear corr_table;
    disp("Frame"+i); %[output:78dbf0c7] %[output:6c9520b9] %[output:065166ba] %[output:50f6fa11] %[output:344f2814] %[output:001c27ea] %[output:7f8cca96] %[output:20167832] %[output:41f9ee75] %[output:943d6239] %[output:03064bc8] %[output:7b05adf1] %[output:50750efa] %[output:90d35c1a] %[output:6f806b99] %[output:9119a012] %[output:1cf51721] %[output:6c44d888] %[output:552e5d52] %[output:485bbd20] %[output:859b48c1] %[output:61a8c8a4] %[output:770016e3] %[output:724c79b4] %[output:67800d21] %[output:4e29f1e3] %[output:5ff724bb] %[output:661b2e23] %[output:755040dc] %[output:5d4969ae] %[output:0c0cf686] %[output:92744287] %[output:62c5d9f7] %[output:2c1a1d1b] %[output:7b84e2ed] %[output:2152fd6c] %[output:71478f94] %[output:78079ed3] %[output:6dd1cb3c] %[output:10f1c9e9] %[output:35d8fa08] %[output:4dd6d079] %[output:172ba721]
end %[output:group:8887bd96]
%%
spotsqpTable = vertcat(cellofcorrs{:,1});
 spotsqpetrTable=spotsqpTable;
%%
%[text] ## make the polarity-relative-to-motion and that \* magnitude values
spotsqpTable.radAng = deg2rad(spotsqpTable.PCAAngle___);
spotsqpTable.Xcomp = abs(cos(spotsqpTable.radAng)); % make the X-component
spotsqpTable.XcompMag = spotsqpTable.Xcomp .* spotsqpTable.PCAMagnitude; % make X-component-magnitude-adjusted
spotsqpTable.Ycomp = abs(sin(spotsqpTable.radAng)); % make the Y-component
spotsqpTable.YcompMag = spotsqpTable.Ycomp .* spotsqpTable.PCAMagnitude;
%%
%[text] ## add tracks and edges to qp-TM spot correlation table
spotsqptrTable = outerjoin(spotsqpTable,tracks,"Keys","TRACK_ID");
CombinedTrackmateQPTable = innerjoin(spotsqptrTable,edgeTable,"LeftKeys","ID","RightKeys","SPOT_TARGET_ID"); %Final output. Save as desirable or pass into import and processing %[output:68a29030] %[output:6ab2a6c7]

